  employmentStatus:string,
  location:string,
}> = (props) => {

  return(
    <div>
      <ul style={{listStyle:"none"}}>
        <li><img src="headshot.jpg"/></li>
        <li><Title level={4}>Brendan Copp</Title></li>
        <li><div style={{display:"block-inline", textAlign:"left"}}>

        <li><p>Employment Status: {props.employmentStatus}</p></li>
        <li><p>Location: {props.location}</p></li>
        <li><p>A recent university graduate with a passion for new technology. </p></li>

        </div></li>
      </ul>
    </div>
  )

}



export default AboutMe
